Defendant Orlando M Felder in court with attorney Mark Stuart Tishberg.  Joy Hammond appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 6 MONTHS in the House of Correction with credit for 2 days time served;  Huber privileges for work, work search and treatment.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 9 MONTHS.
Conditions:
*  AODA assessment/treatment deemed appropriate;
*  Mental Health assessment/treatment deemed appropriate;
*  No contact with Barbara P.;
*  Submit a DNA sample and pay the DNA surcharge;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment; payments to commence February 15, 2016 at the rate of $30.00 per month.
Notice of Right to Seek Postconviction Relief received and filed.
